import { SET } from "./action";
import { baseUrl } from "../shared/baseUrl";
export const FetchApi = () => (dispatch) => {
  return fetch(baseUrl + "dishes")
    .then((response) => {
      return response;
    })
    .then((response) => response.json())
    .then((dishes) => dispatch(SET(dishes)));
};
